getting_started/02_our_first_data_model..body:
Our first data modelWe're using Immuto because we want all our data to be immutable. For a really simple example we'll go with:export interface Person {
    readonly firstName: string;
    readonly lastName: string;
    readonly trusted: boolean;
}
Looks like we have trust issues. But anyway. Save the above into your project directory as Person.ts.Now let's describe this structure to Immuto. At the top of the file add:import { property, reducer } from "immuto";
Then at the bottom continue with:export namespace Person {

    export const empty: Person = {
        firstName: "",
        lastName: "",
        trusted: false
    };

    export const firstName = property("FIRST_NAME", (p: Person) => p.firstName);
    export const lastName = property("LAST_NAME", (p: Person) => p.lastName);
    export const trusted = property("TRUSTED", (p: Person) => p.trusted);

    export const reduce = reducer(empty)
        .action(firstName)
        .action(lastName)
        .action(trusted);

    export type Cursor = typeof reduce.cursorType;
}
We've declared an empty Person (not saying they're emotionally empty.) Then we've declared property helpers for each of the properties we want user to be able to independently edit, giving each one a Redux-style all-caps name.Then we create the reduce function. This is the crux of the Redux approach, but here Immuto writes the function for us.The last part, where we declare a type alias called Cursor, is hard to explain at this point, but we'll get to it soon.

getting_started/03_making_the_ui.html.body:
Making the UIStart a new file and call it PersonEditor.tsx, so we can use JSX in our TypeScript. We'll need to import React of course, and our Person model. We'll also use some components from immuto-react:import * as React from "react";
import { Person } from "./Person";
import { TextInput, CheckBox } from "immuto-react";
In Immuto all the model data is passed in through props, so let's declare the type of our props in TypeScript. There's that mysterious Cursor type we declared in the previous step:export interface PersonEditorProps {
    person: Person.Cursor;    
}
Now we can declare our stateless component for editing a Person. We use destructuring to get the person prop into a simple named variable:export function PersonEditor({person}: PersonEditorProps) {
    return (


                Person


                 Trusted


                Summary
                {person.state.firstName} {person.state.lastName}
                : {person.state.trusted ? "Trusted" : "Not trusted"}


    );
}
By the way, you don't have to use TextInput and CheckBox. They are just thin wrappers around  that make binding very succinct - more about that here.TextInput requires a binding to "talk to". Turns out we can make just what it requires by using the firstName property we defined in our model. Note the simple pattern for looking up a property inside a cursor.cursorToObject.$(TypeName.propertyName)
On a cursor the .$(...) is called the piping operator. This is logically similar to getting a property from an ordinary object:objectInstance.propertyName
If you're into the whole brevity thing, you can make it more succinct in the JSX by destructuring the properties first:const { firstName, lastName, trusted } = Person;
Which means you can just say:
Why does it have to work in this special way? Because we're not traversing through simple references between objects. person is a cursor, and so is person.$(Person.firstName). This is what gives us the power to make changes to the data, even though it's represented immutably.Save this. One last thing we need to do is change index.tsx, which currently renders Hello, world!. So open it up and replace the content with:import * as React from "react";
import { bindToStore } from "immuto-react";
import { Person } from "./Person";
import { PersonEditor } from "./PersonEditor";
Under the imports, add the following:const store = Person.reduce.store();

const App = bindToStore(store, p => );
The first line creates a store to hold the current state of our Person. Behind the scenes it calls the createStore function from Redux, but this way it's given more strict static typing.The second line creates a new component App that requires no props, and which renders PersonEditor using the current content of the store. This means it re-renders whenever the store changes.Finally, put back the call to ReactDOM.render so it uses the new App component:ReactDOM.render(, document.querySelector("#root"));
Save this too. Rebuild everything:$ webpack
Now open index.html in your browser and have fun entering your own name, or that of a celebrity, and deciding whether you trust them. The possibilities are limited!

getting_started/05_a_collection_of_peopl.body:
A collection of peopleNow we're going to deal with a whole room of people at once. Intimidating.Start a new file People.ts and fill it with:import { reducer, array } from "immuto";
import { Person } from "./Person";

export type People = Person[];

export namespace People {

    export const empty: People = [];
    export const at = array(Person);
    export const reduce = reducer(empty).action(at);

    export type Cursor = typeof reduce.cursorType;
}
It's really the same pattern as before. We've given a name to a data structure, only this time it's an array of Person instead of some custom interface we've cooked up.Then we populate the corresponding namespace with the same useful bits and pieces. Doing it this way means we get to control exactly what operations are available on our collection.The one apparent oddity is that instead of declaring properties, we just declare a single thing called at, but go with it for now. All will become clear.Let's jump straight into the UI. Save this as PeopleEditor.tsx:import * as React from "react";
import { People } from "./People";
import { PersonEditor } from "./PersonEditor";

export interface PeopleEditorProps {
    people: People.Cursor;
}

export function PeopleEditor({people}: PeopleEditorProps) {
    return (

        {
            people.state.map((person, index) => (

                    {person.firstName} {person.lastName}


            ))
        }            

    );
}
See how we use People.at? Again, we're using people.$(...) to follow the cursor on to something else. Inside the parentheses we describe the thing we want. Only this time its not a named property, but position in the array, so we pass the position index:people.$(People.at(index))
To see it working, let's modify index.tsx, basically replacing Person with People throughout:import * as React from "react";
import * as ReactDOM from "react-dom";
import { bindToStore } from "immuto-react";
import { People } from "./People";
import { PeopleEditor } from "./PeopleEditor";

const store = People.reduce.store();

const App = bindToStore(store, p => );

ReactDOM.render(, document.querySelector("#root"));
There's one other thing we'll need to do, because we don't (yet) have a way to add or remove items from our list. In the next step, we'll dispatch some actions into our store.

getting_started/06_dispatching_some_peop.body:
Dispatching some peopleHere's one way to set the firstName property of a person in position 0. It's pure Redux, although the action format has a fussy structure:store.dispatch({
    type: "AT",
    payload: {
        key: 0,
        action: {
            type: "FIRST_NAME", 
            payload: { 
                type: "REPLACE", 
                payload: "John" 
            }
        }
    }
});
See how it's nested? Actions inside actions. Each action has type and payload, and sometimes the payload contains a further action. We call this an action path. It just naturally emerges from the structure of the data model.Try it in index.tsx. Also, try changing "John" into 3.14 so it's the wrong type. Or misspell one of the action names. TypeScript won't let you do that.We can do it with cursors instead. Add these to your imports:import { snapshot, replace } from "immuto";
import { Person } from "./Person";
And try:snapshot(store)
    .$(People.at(0))
    .$(Person.lastName)
        (replace("Zoidberg"));
The snapshot function gets a cursor for the current state of the store. It's the Immuto way of doing store.getState(), except it also retains the power of dispatch. As it's a cursor, we can then take the path of our choice down the data structure.The result is a function that we can directly call to dispatch an action. It is a custom dispatch function. replace is a good old action creator, just like in Redux (remember: Immuto is Redux). So we we could have said:snapshot(store)
    .$(People.at(0))
    .$(Person.lastName)
        ({ type: "REPLACE", payload: "Zoidberg" });
Again, any typo such as type: "REPLOCE" is caught instantly. And try piping in the wrong order:snapshot(store).$(Person.firstName) // error: Person[] is not assignable to Person
Our store's internal state is of type People so it's just a plain ol' array of objects:const example: People = [
    { firstName: "Homer",  lastName: "Simpson", trusted: false },
    { firstName: "Marge",  lastName: "Simpson", trusted: true  },
    { firstName: "Bart",   lastName: "Simpson", trusted: false },
    { firstName: "List",   lastName: "Simpson", trusted: true  },
    { firstName: "Maggie", lastName: "Simpson", trusted: false },
]
So I guess we could copy it into the store like this:for (let p = 0; p 
On the other hand, it would be nice if we could just throw the whole example straight in the store. Let's do something completely off-the-wall and define an action! Go into People.ts and fix your immuto import so it says:import { reducer, array, action } from "immuto";
Then between the at and reduce declarations, add:export const initialize = action("INITIALIZE", 
    (state: People, payload: People) => payload);
See how we have to write a kind a partial reducer? We just get given the current state and the payload of our action. The state needs to be the right type for the object, in this case People, but the type of payload could be anything we want (usually something JSON-compatible though. In this case we set the payload to be of type People so we can simply return it as the new state, throwing away the old state.Finally, tack it on to the reducer:export const reduce = reducer(empty)
        .action(at)
        .action(initialize);
With this added ingredient, all we need in index.tsx is:store.dispatch(People.initialize(example));
People.initialize is an action creator. We just pass it the payload. Again, to be super clear, we could have said:store.dispatch({ type: "INITIALIZE", payload: example });
So in summary, this is all index.tsx now needs to contain:import * as React from "react";
import * as ReactDOM from "react-dom";
import { bindToStore } from "immuto-react";
import { People } from "./People";
import { PeopleEditor } from "./PeopleEditor";

const store = People.reduce.store();

const App = bindToStore(store, p => );

ReactDOM.render(, document.querySelector("#root"));

const example: People = [
    { firstName: "Homer",  lastName: "Simpson", trusted: false },
    { firstName: "Marge",  lastName: "Simpson", trusted: true  },
    { firstName: "Bart",   lastName: "Simpson", trusted: false },
    { firstName: "Lisa",   lastName: "Simpson", trusted: true  },
    { firstName: "Maggie", lastName: "Simpson", trusted: false },
]

store.dispatch({ type: "INITIALIZE", payload: example });
Let's give it a whirl:$ webpack
Open index.html in your browser and try changing the names of the Simpsons family. It's really awesome.To be continued...

how_it_works/how_textinput_works.html.body:
How TextInput worksThe source for TextInput is so short, leaving aside some interface declarations, it's worth taking a look to see how little magic is involved.Basically it's Redux being played out on a microscopic scale.First, you need to know that actions in Immuto always conform to this interface:export interface Action {
    readonly type: T;
    readonly payload: P;
}
Second, those things we previously talked about called cursors are represented by this interface:export interface Cursor {
    readonly state: S;
    (action: A): Cursor;
}
So a cursor is a function that (a) accepts an action (and returns another cursor) and (b) has a state property so you can access the current value. It's like a terse, immutable version of a Redux store.Third, there's a built-in action creator in Immuto called replace, which builds an action such as:{ type: "REPLACE", payload: "Homer" }
The intention of a "REPLACE" action is to tell its target to replace the existing value with the one in the payload.And last, there's a type called Property, defined as:export type Property = Cursor>;
So it's just a cursor that only supports "REPLACE" actions, and (as you'd expect) its state is the same type that it receives in the replacement payload.So with this knowledge, you may be able to predict how TextInput works. No cheating! Okay, you can look now:export interface TextInputProps extends StandardTextInputProps {
    binding: Property;
}

export const TextInput = (props: TextInputProps) => (
     props.binding(replace(e.currentTarget.value))} />
);
It's just an  element. Any properties besides binding are passed straight through, so you can use it just as you would a plain .The key to understanding it is to see how it reads and writes values through the binding prop. To read, it accesses state, which contains the current value of the string. To write, it calls binding as a function, passing it an action built with the replace action builder.In Immuto, exactly the same Redux concepts (immutable data updated by actions) are applied at the very small scale of individual values, all the way out to the scale of the entire application.
